// index.js or index.jsx
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import React from 'react';
import { createRoot } from 'react-dom/client'; // Import from 'react-dom/client'
import App from './App';
// Standard Bootstrap CSS
import 'bootstrap/dist/css/bootstrap.min.css';
// Your custom Tim Creative theme CSS, adjust the path as per your actual file location
import './client/assets/css/your-tim-creative-theme.css'; // Update with your actual file name

// Replace ReactDOM.render with createRoot().render
const rootElement = document.getElementById('root');
const root = createRoot(rootElement);

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
